import React from 'react';

import Select from 'react-select';

const colourOptions = {
  1: '#373948',
  2: 'white',
  3: '#DDE1E3',
  4: '13px',
}
export default () => (
  <Select
    isMulti
    name="colors"
    options={colourOptions}
    className="basic-multi-select"
    classNamePrefix="select"
  />
);
